import React from 'react';

function Project(props) {
  	let projectItems;
  	if(props.project) {
  		projectItems = props.project.map(project => {
  			<projectItem project={project} />
 		});	
  	}

  	return (	
	    <div className="Project">
	    	{projectItems}	    
	    </div>
	);


}

export default Project;
